import { useState } from "react";
import { Button } from "@/components/ui/button";
import { Card, CardContent } from "@/components/ui/card";

export default function ChatGPTClone() {
  const [content, setContent] = useState("Seleccione una opción");

  return (
    <div className="flex h-screen">
      {/* Sidebar */}
      <div className="w-1/4 bg-gray-900 text-white p-4 flex flex-col gap-2">
        <Button className="w-full" onClick={() => setContent("Mostrando datos 1")}>Opción 1</Button>
        <Button className="w-full" onClick={() => setContent("Mostrando datos 2")}>Opción 2</Button>
        <Button className="w-full" onClick={() => setContent("Mostrando datos 3")}>Opción 3</Button>
      </div>

      {/* Main Content */}
      <div className="w-3/4 p-6 bg-gray-100 flex justify-center items-center">
        <Card className="w-full max-w-2xl">
          <CardContent className="p-4 text-center text-lg">
            {content}
          </CardContent>
        </Card>
      </div>
    </div>
  );
}
